The zunzún, also known as the hummingbird or hummingbird, is very common throughout Cuba. These animals generally use their legs very little as they are found flying almost all the time.
Hummingbirds, in their seemingly carefree and happy flight, remind you to live in the moment and enjoy the simple pleasures in life. Also, because they often appear suddenly, they remind you that joy is unpredictable and can be just around the corner; and that, at the same time, can be as fleeting as the time they remain before your eyes. So you have to know how to enjoy every moment.
